const Cart = () => {
  return (
    <div className="content">
      <div className="container container--cart">
        <div className="cart">
          <div className="cart__top">
            <h2 className="contetnt__title"></h2>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cart;
